import React from 'react';
import './Nft.css';

const Nft = () => {
  return (
    <div className="nft-container">
      <h1 className="nft-title">Welcome to Loan Chain</h1>
      <h2 className="nft-subtitle">Loans become simple using NFT's</h2>
      <p className="nft-description">
        Loan Chain revolutionizes lending by leveraging blockchain technology and NFTs, making loans secure, transparent, and accessible.
      </p>
    </div>
  );
};

export default Nft;
